import React, { useState } from 'react'

function InputArea(){
    const [inputNote, setInputNote] = useState({
        title: "",
        content: ""
    })

    return <div className='note'>
        <h1>{inputNote.title}</h1>
        <p>{inputNote.content}</p>
    </div>
}

export default InputArea;
